import React from "react";
import "../Dialogs.css";
import styles from "./Chat.module.css";

const Chat = () => {
    return (
        <div className="dialog">
            <div className= {styles.cht}>
                <textarea className={styles.textarea} placeholder="Ваше сообщение"></textarea>
                <button className={styles.btn}><i className="fas fa-paper-plane" alt="send" /></button>
            </div>
        </div>
    );
}

export default Chat;
